import React, {Component} from 'react';

import json from './emoji.json';

class typeemo extends Component{

    render(){
        <div><input type="text"/>
        const emojiList=json.map(emojis=><h1>{emojis.symbol}</h1>)
        return(<h1>{emojiList}</h1>)</div>;
    }
}

export default typeemo
